import { ContCartas, Datos, Imagen, Info } from "../../styles/styled-components"
import img from "../../resources/profile.jpg"

export default function About (){
    return(
        <ContCartas>
            <Datos>Author: trechi.</Datos>
            <br></br>
            <Imagen src={$(img)} alt="Mi foto de perfil"/>
            <Info>Página web con temática de la serie animada Rick and Morty. Aquí podrás conocer los personajes de la serie.</Info>
        </ContCartas>
    )
}
